DROP TABLE IF EXISTS `admin_archives`;
CREATE TABLE `admin_archives` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `number` varchar(255) DEFAULT NULL COMMENT '文号',
  `title` varchar(255) DEFAULT NULL COMMENT '文件标题',
  `department` varchar(255) DEFAULT NULL COMMENT '发文部门',
  `create_time` datetime DEFAULT NULL COMMENT '收文时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `archives_type` int(11) DEFAULT NULL COMMENT '文件类型',
  `path` varchar(255) DEFAULT NULL COMMENT '文件保存位置',
  `is_digital` int(11) DEFAULT NULL COMMENT '是否有电子版',
  `memo` varchar(255) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=417 DEFAULT CHARSET=utf8 COMMENT='人社局收文档案';

